import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Form from './common/form/main';


ReactDOM.render(<Form class="123" method="get" token="token" hash="hash" />, document.getElementById('app'));

serviceWorker.unregister();
